	Menu.prototype.previewSfx=function(ev)
	{
		//previewSfx
		var names=MG.sfx.getNames();
		MG.sfx.play(names[ev.currentTarget.value]);
	}
	Menu.prototype.previewSprite=function(ev)
	{
		console.log("previewSprite "+ev.currentTarget.value);
		var all_sprites=MG.sprites.getNames();
		this.showSprite=all_sprites[ev.currentTarget.value];
		this.anim="";
		this.fr=0;
		this.f=0;
	}
	Menu.prototype.doDancingMan=function(ev)
	{
		//console.log("menu is animating!");
		
		
//		for(var all in this.showSprite.ss) anims.push(all);
//		var anims=["step","up_down","kick","kick2","flubber","knee_bounce"];
		if(this.showSprite=="")
		{
			var all_sprites=MG.sprites.getNames();
			console.log("all_sprites: "+all_sprites);
			var sel=this.sprite_preview;
			// destroy any old options
			for (var i = 0; i <  sel.options.length; i++) {
				sel.options[i] = null;
			}
			// set new options to all sprites.
			for(i=0;i<all_sprites.length;i++)
			{
				var opt = document.createElement("option");
				opt.value = i;
				opt.textContent = all_sprites[i];
				sel.appendChild(opt);
			}
			if(all_sprites.length==0)
			{	
				window.requestAnimationFrame(this.doDancingMan.bind(this));			
				return;
			}
			var r=Math.floor(Math.random()*all_sprites.length);
			this.showSprite=all_sprites[r];
			sel.selectedIndex=r;
			sel.addEventListener("change",this.previewSprite.bind(this));
		}
		var anims=MG.sprites.getAnims(this.showSprite);
		if(this.anim=="")
		{
			this.anim=anims[Math.floor(Math.random()*anims.length)];
		}
		var ctx=this.canv.getContext("2d");
		ctx.drawImage(lib.back,0,0);
		this.fr+=1000/14.042/400;
		var old_f=this.f;
		this.f=Math.floor(this.fr)%MG.sprites.totalFrames(this.showSprite,this.anim);
		if(this.f==0 && old_f!=this.f)
		{
			this.measure++;
			if(this.measure%4==0 || Math.random()<0.2)
			{
				this.anim=anims[Math.floor(Math.random()*anims.length)];
			}
		}
		var frame=MG.sprites.getFrame(this.showSprite,this.anim,this.f);
		if(frame!=null)
			MG.sprites.draw(ctx,this.showSprite,this.anim,270,460,this.f,0,1,1);
		
		if(this.dom.style.display!="none")
			window.requestAnimationFrame(this.doDancingMan.bind(this));
	}
	Menu.prototype.doMenuButton=function(ev)
	{
		var button_name=ev.currentTarget.getAttribute("name");;
		switch(button_name)
		{
			case "play":
				MG.game.reset();
				MG.flow.gotoPage("editor_page");
				MG.game.start();
			break;
			case "options":
				MG.flow.gotoPage("options");
			break;			
			default:
				console.log("button: "+button_name+" not supported yet");
			break;
		}
		
		
	}
	
